import React, { Component } from 'react';
import AboutUs from './AboutUs';
import Contact from './Contact';

class App extends Component {
    render() {
        return (
            <div>
                <div>Welcome to Mix and Match!</div>
                <hr />
                <AboutUs />
                <hr />
                <Contact />
            </div>
        )
    }
}

export default App;
